package com.mycompany.ClinicaOdontologica.model;import jakarta.persistence.Entity;import lombok.Getter;import lombok.Setter;import java.util.Date;@Getter@Setter@Entitypublic class Patient extends Person{    private String medicalInsurance;    private String bloodType;    public Patient() {    }    public Patient(Long idPerson, String dni, String name, String lastname, String phoneNumber, String address, Date birthdate, String medicalInsurance, String bloodType) {        super(idPerson, dni, name, lastname, phoneNumber, address, birthdate);        this.medicalInsurance = medicalInsurance;        this.bloodType = bloodType;    }}